import {SafeAreaView} from 'react-native';
import CurrencyConverter from './CurrencyConverter';

const App = () => {
  return (
    <SafeAreaView>
      <Text>Choose the currency and the amounts to get the exchange rate</Text>
      <CurrencyConverter/>
    </SafeAreaView>
  );
}

export default App;
